import React from "react";
import Layout from "../../components/Layout";
const propTypes = {};

const defaultProps = {};

export default function index({ url }) {
  return (
    <Layout>
      <h1>{url.query.slug}</h1>
    </Layout>
  );
}

index.propTypes = propTypes;
index.defaultProps = defaultProps;
